                          </select></td>
                        <td width={20}>to</td>
                        <td width={85}><select name="time" id="SundayEndTime">
                          <option value="08:00:00">8:00 AM</option>
                          <option value="09:00:00">9:00 AM</option>
                          <option value="10:00:00">10:00 AM</option>
                          <option value="11:00:00">11:00 AM</option>
                          <option value="12:00:00">12:00 PM</option>
                          <option value="13:00:00">1:00 PM</option>
                          <option value="14:00:00">2:00 PM</option>
                          <option value="15:00:00">3:00 PM</option>
                          <option value="16:00:00">4:00 PM</option>
                          <option value="17:00:00">5:00 PM</option>
                          </select></td>
                          <td width={60} style={{paddingBottom: "0px", paddingLeft: "5px"}}>Slots: </td>
                          <td width={40}><input type='text' placeholder='0' style={{height: "10px", paddingLeft: "8px", paddingBottom: "10px" }} onChange={(e) => setSlots(e.target.value)}/></td>
                          <td style={{verticalAlign: "bottom", paddingLeft: "10px", paddingTop: "2px"}}><a href='#' onClick={handleSundayAddTimeSlotClick}><u>Add Time Slot</u></a></td>
                      </>)}
                    </tr>
                    {showSundayTableData && showSundayAddTimeSlot && (<>
                    <tr>
                        <td width={25}></td>
                        <td width={0}></td>
                        <td width={50}>Time: </td>
                        <td width={85}><select name="time" id="SundayStartTime">
                          <option value="08:00:00">8:00 AM</option>
                          <option value="09:00:00">9:00 AM</option>
                          <option value="10:00:00">10:00 AM</option>
                          <option value="11:00:00">11:00 AM</option>
                          <option value="12:00:00">12:00 PM</option>
                          <option value="13:00:00">1:00 PM</option>
                          <option value="14:00:00">2:00 PM</option>
                          <option value="15:00:00">3:00 PM</option>
                          <option value="16:00:00">4:00 PM</option>
                          <option value="17:00:00">5:00 PM</option>
                          </select></td>
                        <td width={20}>to</td>
                        <td width={85}><select name="time" id="SundayEndTime">
                          <option value="08:00:00">8:00 AM</option>
                          <option value="09:00:00">9:00 AM</option>
                          <option value="10:00:00">10:00 AM</option>
                          <option value="11:00:00">11:00 AM</option>
                          <option value="12:00:00">12:00 PM</option>
                          <option value="13:00:00">1:00 PM</option>
                          <option value="14:00:00">2:00 PM</option>
                          <option value="15:00:00">3:00 PM</option>
                          <option value="16:00:00">4:00 PM</option>
                          <option value="17:00:00">5:00 PM</option>
                          </select></td>
                        <td width={60} style={{paddingBottom: "0px", paddingLeft: "5px"}}>Slots: </td>
                        <td width={40}><input type='text' placeholder='0' style={{height: "8px", paddingLeft: "8px", paddingBottom: "10px" }} onChange={(e) => setSlots(e.target.value)}/></td>
                    </tr>
                    </>)}
                  </table> 
                </div>
            </div>
        </form>
        <button type="button" onClick={handleAddClinic}>Register</button>
      </div>
      
    </div>
    <DoctorFooter/>
    </div>
  );
};
export default DoctorAddClinic;
